import React from 'react';
import facebook from '../facebook.svg';
import home_black_24dp from '../home_black_24dp.svg';

export default function Navbar() {
  return (
    <div>
      <nav>
        <div>
            <div>
               <span><facebook /></span>
               <input type='search' placeholder='Rechercher sur facebak'></input>
            </div>
            <div>
               <home_black_24dp />
            </div>
        </div>
      </nav>
    </div>
  );
}
